export const CREATE_SCAR_MUTATION = gql`
  mutation CREATE_SCAR_MUTATION(
    $bodySites: [String!]!
    $causes: [String!]!
    $conditions: [String!]!
    $prevTreatment: Boolean!
    $image: String!
    $posasScore: Int!
    $addedAt: DateTime!
    $date: DateTime!
  ) {
    createScar(
      bodySites: $bodySites
      causes: $causes
      conditions: $conditions
      prevTreatment: $prevTreatment
      image: $image
      posasScore: $posasScore
      addedAt: $addedAt
      date: $date
    ) {
      id
    }
  }
`;
